import React from 'react'
import { render } from 'react-dom'
import '../../App.css';
import Button from 'react-bootstrap/Button';
import DropdownButton from 'react-bootstrap/DropdownButton';
import Dropdown from 'react-bootstrap/Dropdown';


export default class Navbar extends React.Component{
	render() {
		return (
			<nav class="navbar fixed-top navbar-light">
			<a class="navbar-brand" href="#">
			<img src="https://zerodebug.com/images/logo_zerodebug_text_white.png" width="200"></img>
			</a>
			<DropdownButton id="dropdown-basic-button" title="Select App">
  <Dropdown.Item href="#/action-1"><img src="https://zerodebug.com/images/ta_icon_1024.png"  height="20"></img> touchAblePro</Dropdown.Item>
  <Dropdown.Item href="#/action-2">studiomux</Dropdown.Item>
  <Dropdown.Item href="#/action-3">soda</Dropdown.Item>
  <Dropdown.Item href="#/action-3">modstep</Dropdown.Item>
</DropdownButton>
			<form class="form-inline my-2 my-lg-0">
			<input class="form-control mr-sm-2" type="search" placeholder="Search" aria-label="Search"></input>
			<button class="btn btn-outline-success my-2 my-sm-0" type="submit">Search</button>
			</form>
			<a class="navbar-brand" href="#">Sticky top</a>
			<button class="btn btn-outline-success" type="button">Main button</button>
			<button class="btn btn-sm align-middle btn-outline-secondary" type="button">Smaller button</button>
			</nav>
			);
	}
}
